import java.util.ArrayList;import java.util.Arrays;import java.util.Collections;import java.util.Scanner;import java.lang.Math; public class Account {			public static void main (String[] args) {				Scanner sc= new Scanner(System.in) ;		int n= sc.nextInt() ;		ArrayList<Integer> list= new ArrayList<>() ;		list.add(1) ;		if(n == 1) {			System.out.println("1");			return ;		}		int i= 2 , d= 1 ;		while(i < n) {			if(n%i == 0) {				list.add(i) ;				d= i ;			}			i += d ;		}		list.add(n) ;		for( i= list.size()-1 ;i>=0 ;i-- ) {			System.out.print(list.get(i)+" ");		}	}	}
